import React, { useState } from "react";
import "./Listview.css";
import ydot from "./Images/yellowdot.png";
import rdot from "./Images/rdot.png";
import bdot from "./Images/bluedot.png";
import dictum from "./Image/dictum.png"

export default function Listview() {
  return (
    <>
      <div className="listview">
        <div className="listview_col1">
          <img src={dictum} />
        </div>
        <div className="listview_col2">
          <div className="listview_col2_row1">
            <h4>Dictum morbi</h4>
            <div className="listview_col2_row1_dots">
              <div>
                <img src={ydot} />
              </div>
              <div>
                <img src={rdot}/>
              </div>
              <div>
                <img src={bdot}/>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
